import React from 'react';
// import ava1 from '../assets/img/ava1.jpg'; // Chỉ cần 1 lần '../'
import ava2 from '../assets/img/ava2.jpg'; // Chỉ cần 1 lần '../'

const MenuBox = () => {
  return (
    <div className='menu_box'>
      <img src={'../assets/img/ava1.jpg'} alt='Avatar 1' />
      <img src={ava2} alt='Avatar 2' />
    </div>
  );
};

export default MenuBox;
